import '../App.css';
import img from './pictures'

const MainContent = () => {
    return (

        <div className="profile-pic-container">
        <div className="profile-pic">
        <img src="./pictures/profile-pic.jpg" alt="Nishanth B M profile picture"/>
        </div>
        <p className="profile-text">Hello, I'm </p>
        <h1 className="title">Nishanth B M</h1>
        <p className="profile-text_2">Frontend Developer</p>




        </div>
    )
}

export default MainContent;
